#MeToo #metooGR #καμιαανοχη https://t.co/FdA7QxWIvm https://t.co/aawM0WD1rA

"Μετά από 60 χρόνια θυμήθηκαν αυτές οι κυρίες ότι τις βίασαν";
Πόσα χρόνια μετά θα ήταν αποδεκτό κ. #Ευστρατιαδη κατά τη γνώμη σας και εκ του ασφαλούς να μιλήσουν οι γυναίκες για το βιασμό τους;
#MeToo #metooGR @NonoraM @MegaTvOfficial  
