Κάπου διάβασα ότι κατά τη διάρκεια της κατάθεσης της 17χρονης που κατήγγειλε ομαδικό βιασμό η ανακρίτρια (ναι, γυναίκα) τη ρώτησε γιατί ανέβαζε φωτογραφίες στα κοινωνικά δίκτυα στις οποίες φορούσε "προκλητικά" ρούχα.
Πιστεύετε ακόμα ότι υπάρχει ελπίδα;
